// Custom hook for Formeo Editor
export function useFormeoEditor(options = {}) {
  const editorRef = useRef(null);
  const containerRef = useRef(null);
  const [formData, setFormData] = useState(null);

  const initializeEditor = useCallback(() => {
    if (containerRef.current && !editorRef.current) {
      const defaultOptions = {
        editorContainer: containerRef.current,
        sessionStorage: true,
        events: {
          onSave: (data) => {
            setFormData(data);
            options.onSave?.(data);
          },
          onChange: (data) => {
            setFormData(data);
            options.onChange?.(data);
          }
        }
      };

      editorRef.current = new FormeoEditor({
        ...defaultOptions,
        ...options
      });
    }
  }, [options]);

  const destroyEditor = useCallback(() => {
    if (editorRef.current?.destroy) {
      editorRef.current.destroy();
      editorRef.current = null;
    }
  }, []);

  const saveForm = useCallback(() => {
    if (editorRef.current) {
      const data = editorRef.current.formData;
      setFormData(data);
      return data;
    }
    return null;
  }, []);

  const loadForm = useCallback((data) => {
    if (editorRef.current && data) {
      editorRef.current.render(data);
      setFormData(data);
    }
  }, []);

  const clearForm = useCallback(() => {
    if (editorRef.current) {
      editorRef.current.clear();
      setFormData(null);
    }
  }, []);

  useEffect(() => {
    initializeEditor();
    return destroyEditor;
  }, [initializeEditor, destroyEditor]);

  return {
    containerRef,
    formData,
    saveForm,
    loadForm,
    clearForm,
    editor: editorRef.current
  };
}

